import './WelcomeMessage.css'

function WelcomeMessage () {

	return (
        <>
            <img src='images/pokebola-cor.png' alt='Pokebola usada como radio button'/>
            <h1 className="form-title">
                Find out your six
                <img src="images/logo-pokemon.png" alt="Pokémon logo" />
            </h1>
            <div className="container">
                    {/* <p>This website was created as a study project. Studying doesn't have to be boring and develop fun apps to enhance my skills while building a strong portfolio is one of my favortie activities.</p> */}
                    <p>Want to find out which Pokémon you'd carry with you if you're on your adventure to become a Pokémon Master? <br/><br/>Hit the button and let's have fun!</p>
                    
                    <button className='home-button'>Start quizz!</button>
            </div>
        </>
    );
}

export default WelcomeMessage;
